import { Morph } from "lively.morphic/morph.js";
import { connect, disconnectAll } from "lively.bindings/index.js";

export default class UndoViewer extends Morph {
  static get properties (){
    return {
      target: {defaultValue: null,
              set(target) {
                this.setProperty("target", target);
              }},
      maxLength: {defaultValue: 100}
    }
  }
  onLoad() {
        this.getQueue(this.target)
        var propertyList = this.getSubmorphNamed('propertyList'),
        valueList = this.getSubmorphNamed('valueList')
        disconnectAll(propertyList)
        connect(propertyList,'onMouseUp',this,'updateValues',(obj)=>{
          var {source,target} = this.varMapping,
              selection = source.selection
            target.filterFor(selection)
        })
        if (this.undoQueue){
          propertyList.items = []
          var properties = []
          this.undoQueue.forEach(function(ea){

            if (properties.indexOf(ea.prop) == -1){
              properties.push(ea.prop)
            }
          })
          console.log(properties)
          propertyList.items = properties
        }
  }
  getQueue(target){
    this.undoQueue = (target ? target.env.changeManager.changes.filter(function(ea){
      return ea.target = target
    }) : []).slice(-1 * this.maxLength)
    console.log(this)
  }
  updateValues(aList){
    // alert(aList)
  }
  filterFor(property){
    var valueList = this.getSubmorphNamed('valueList')
    var items = this.undoQueue.map(function(obj){
      var display = JSON.stringify(obj.prevValue) + ' -> ' + JSON.stringify(obj.value)
      return {toString: function(){ return display},
             ...obj}
    }).filter(function(obj){
      return obj.prop == property
    })
    valueList.items = items
  }

}

